import React from 'react';
import PropTypes from 'prop-types';
import { InputGroup, Icon, Label, large } from '@blueprintjs/core';
import { IconNames } from '@blueprintjs/icons';

const CustomInput = ({ placeholder, iconName, class_ }) => {
  if (iconName === 'Search') {
    const icon = <Icon icon={IconNames.SEARCH} iconSize={Icon.SIZE_LARGE} />;
    return (
      <Label>
        Hello
        <InputGroup
          placeholder={placeholder}
          className={class_}
          leftIcon={icon}
          large
        />
      </Label>
    );
  }
  return (
    <Label>
        Hello
      <InputGroup placeholder={placeholder} className={class_} />
    </Label>
  );
};
CustomInput.defaultProps = {
  class_: 'input',
};
CustomInput.propTypes = {
  placeholder: PropTypes.string.isRequired,
  iconName: PropTypes.string.isRequired,
  class_: PropTypes.string,
};
export default CustomInput;
